### Current behavior

I have encountered a problem when using Cypress for API testing. To provide some context, I first create an array called apis, which contains objects with information about different API endpoints, including their names and URLs. I then use a map function to iterate over this array and send GET requests to these API endpoints using the cy.request command. The responses from these requests are aliased with their respective names.
```
    const apis = [
      {
        name: "posts",
        url: "https://jsonplaceholder.typicode.com/posts",
      },
      {
        name: "albums",
        url: "https://jsonplaceholder.typicode.com/albums",
      },
      {
        name: "comments",
        url: "https://jsonplaceholder.typicode.com/comments",
      },
      {
        name: "photos",
        url: "https://jsonplaceholder.typicode.com/photos",
      },
    ];
    apis.map(({ name, url }) => {
      cy.request({
        url: url,
        method: "GET",
      }).as(name);
    });
```
After creating the aliases, I attempt to wait for the completion of these requests using the cy.wait command with an array of aliases, like this:
```
    cy.wait(["@posts", "@albums", "@comments", "@photos"]).then((res) => {
      console.log(res);
    });
```
![Screenshot 2023-10-27 at 2 04 41 PM](https://github.com/cypress-io/cypress/assets/81914672/a862841e-a364-443f-bdc1-06660b68ced4)



### Desired behavior

_No response_

### Test code to reproduce

https://github.com/DanielDevel/array-parameter-cy-wait-not-working

### Cypress Version

13.3.3

### Node version

v19.7.0

### Operating System

macOs 14.1

